def lengthOfLongestSubstring(s: str) -> int:
    dict = {}
    lengths = []
    i = 0
    index = 0
    for index, letter in enumerate(s[i:]):
        try:
            if dict[letter]:
                lengths.append(len(dict))
                dict = {}
                dict[letter] = letter
                i = index
        except KeyError:
            dict[letter] = letter
    lengths.append(len(dict))
    dict = {}
    return max(lengths)

